  const [countries, setCountries] = useState([]);

  useEffect(() => {
    axios
      .get("https://restcountries.com/v2/all?fields=name,region,area")
      .then((response) => {
        setCountries(response.data);
      });
  }, []);

  console.log(countries);

  return (
    <div>
        <table>
            <thead>
